import React from 'react';
import CoorsLight from '../../images/beers/CoorsLight.jpg';

const CoolStuff = () => {
  const titleStyle = {
    borderBottom: "2px solid #fff",
    maxWidth: "500px",
    margin: "auto",
    padding: "10px"
  }
  return (
    <div className="cool-stuff pt-6 pb-6">
      <h1 style={titleStyle}>Beer Of The Week</h1>
      <div className="row justify-content-center">
        <div className="col-4">
          <div className="m-4">
            <img src={CoorsLight} className="rounded mw-100" alt="Shane" />
          </div>
        </div>
        <div className="col-4 align-self-center">
          <div className="h2">
            Shane Moody
                </div>
          <p className="sub-text">Born and raised in Denver, Colorado. Played college football at the University of Montana.
              Now a personal trainer at Elite Speed Performance in Denver.</p>
        </div>
      </div>
    </div>
  )
}

export default CoolStuff;
